oxy_webhelp_navlinks = {"rbk_cdm_soft_upgrade_rsc-d23139e3258":{"topics":[{"title":"Rubrik CDM software upgrade package download","shortdesc":"<p class=\"shortdesc\">With<span class=\"ph\">RSC<\/span>, you can download the Rubrik CDM software upgrade package         to the Rubrik cluster before starting the upgrade.<\/p>","href":"saas\/download_rbk_cdm_soft_upgrade_package.html","attributes":{"data-id":"download_rbk_cdm_soft_upgrade_package"},"menu":{"hasChildren":false},"tocID":"download_rbk_cdm_soft_upgrade_package-d23139e3274","next":"download_rbk_cdm_soft_upgrade_package-d23139e3274"},{"title":"Rubrik CDM software upgrade using <span class=\"ph\">RSC<\/span>","shortdesc":"<p class=\"shortdesc\">After you have downloaded the Rubrik CDM software upgrade package, you can upgrade         the Rubrik CDM version running on any connected Rubrik cluster to the latest version using             <span class=\"ph\">RSC<\/span>.<\/p>","href":"saas\/upgrade_rbk_cdm_soft_rsc.html","attributes":{"data-id":"upgrade_rbk_cdm_soft_rsc"},"menu":{"hasChildren":false},"tocID":"upgrade_rbk_cdm_soft_rsc-d23139e3302","next":"upgrade_rbk_cdm_soft_rsc-d23139e3302"},{"title":"Viewing precheck logs and rerunning precheck","shortdesc":"<p class=\"shortdesc\">If precheck errors occur while downloading a Rubrik CDM software upgrade package or         upgrading the Rubrik CDM software of a Rubrik cluster, view the precheck errors, resolve         those errors, and manually rerun the precheck to ensure that the Rubrik cluster is ready for         an upgrade.<\/p>","href":"saas\/viewing_precheck_logs_rerun_prechecks.html","attributes":{"data-id":"viewing_precheck_logs_rerun_prechecks"},"menu":{"hasChildren":false},"tocID":"viewing_precheck_logs_rerun_prechecks-d23139e3334","topics":[]},{"title":"Viewing upgrade logs","shortdesc":"<p class=\"shortdesc\">After you have started the operation to download a Rubrik CDM software upgrade         package or started upgrading the Rubrik CDM software version, you can view the upgrade logs         to know the current status of the operation. If the upgrade fails, you can create a Rubrik         Support ticket or rollback to the previous Rubrik CDM software if you are using the fast         upgrade.<\/p>","href":"saas\/viewing_the_upgrade_logs.html","attributes":{"data-id":"viewing_the_upgrade_logs"},"menu":{"hasChildren":false},"tocID":"viewing_the_upgrade_logs-d23139e3345","topics":[]},{"title":"Rubrik cluster upgrade states","shortdesc":"<p class=\"shortdesc\">Information about how a Rubrik cluster transitions through specific states when the         installed Rubrik CDM software version is upgraded.<\/p>","href":"saas\/rubrik_cluster_upgrade_states.html","attributes":{"data-id":"rubrik_cluster_upgrade_states"},"menu":{"hasChildren":false},"tocID":"rubrik_cluster_upgrade_states-d23139e3356","topics":[]}]}};